		/// <summary> 
	  /// 	GenerateName methods generates the names
	  /// </summary> 	
		public string GenerateName(Gender gender, bool addSurname = true, bool addMiddleName = false)
		{
			CharacterName names =  this.CreateName(gender, addSurname, addMiddleName);
			string middleName = "";

			if (addSurname) {
				if (addMiddleName) {
					middleName = names.GetMiddleName() + " ";
				}

				return System.Threading.Thread.CurrentThread.CurrentCulture.TextInfo.ToTitleCase((names.GetFirstName() +" "+ middleName + names.GetSurname()).ToLower());
			}

			return System.Threading.Thread.CurrentThread.CurrentCulture.TextInfo.ToTitleCase(names.GetFirstName().ToLower());
		}

		public CharacterName GenerateNameObject(Gender gender, bool addSurname = true, bool addMiddleName = false) {
			return this.CreateName(gender, addSurname, addMiddleName);
		}

		private CharacterName CreateName(Gender gender, bool addSurname, bool addMiddleName) {
				string firstName   = "";
				string middleName  = "";
				string surname     = "";

				int rand = 0;
				switch(gender) {
					case Gender.Female:
						firstName = firstNamesFemale[Random.Range(0, firstNamesFemale.Count)];

						if (addMiddleName) {
							middleName = firstNamesFemale[Random.Range(0, firstNamesFemale.Count)];						
						}
					break;
					case Gender.Male:
						firstName = firstNamesMale[Random.Range(0, firstNamesMale.Count)];

						if (addMiddleName) {
							middleName = firstNamesMale[Random.Range(0, firstNamesMale.Count)];						
						}					
					break;
					case Gender.Other:
					default:
						rand = Random.Range(0,2);
						if (rand == 0)
                        {
							firstName = firstNamesFemale[Random.Range(0, firstNamesFemale.Count)];

							if (addMiddleName) {
								middleName = firstNamesMale[Random.Range(0, firstNamesMale.Count)];						
							}


                            gender = Gender.Female;
                        }
                        else
                        {
							firstName = firstNamesMale[Random.Range(0, firstNamesMale.Count)];

							if (addMiddleName) {
								middleName = firstNamesFemale[Random.Range(0, firstNamesFemale.Count)];						
							}

                        gender = Gender.Male;

                    }

                    break;
				}		

				if (addSurname) {
					surname = surnames[Random.Range(0, surnames.Count)];
				}			

				return new CharacterName(firstName, middleName, surname, gender);
		}
	}

	/// <summary> 
  /// 	Gender enum to be used with the NameGenerator::GenerateNames method
  /// </summary> 	
	public enum Gender : int {
		Female,
		Male,
		Other
	}
